(6, 1, '2020-06-10 06:59:38', '0000-00-00 00:00:00', '<!-- wp:paragraph -->\n<p>Bienvenue sur votre site ! C’est votre page d’accueil que vos visiteurs verront lorsqu’ils arriveront sur votre site la première fois.</p>\n<!-- /wp:paragraph -->', 'Accueil', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2020-06-10 06:59:37', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress-Ecomerce/?page_id=6', 0, 'page', '', 0),
(7, 1, '2020-06-10 06:59:38', '0000-00-00 00:00:00', '<!-- wp:paragraph -->\n<p>Vous pourriez être un artiste et vouloir présenter vos travaux et vous même ou encore être une entreprise avec une mission à promouvoir.</p>\n<!-- /wp:paragraph -->', 'À propos de', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2020-06-10 06:59:37', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress-Ecomerce/?page_id=7', 0, 'page', '', 0),
(8, 1, '2020-06-10 06:59:38', '0000-00-00 00:00:00', '<!-- wp:paragraph -->\n<p>C’est une page avec des informations de contact de base, comme l’adresse et le numéro de téléphone. Vous pouvez aussi essayer une extension pour ajouter un formulaire de contact.</p>\n<!-- /wp:paragraph -->', 'Contact', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2020-06-10 06:59:37', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress-Ecomerce/?page_id=8', 0, 'page', '', 0),
