(13, 1, '2020-06-10 06:59:38', '0000-00-00 00:00:00', 'If several languages coalesce, the grammar of the resulting language is more simple and regular than that of the individual languages. The new common language will be more simple and regular than the existing European languages. It will be as simple as Occidental; in fact, it will be Occidental.', 'Montain and Winter Cold Weather', '', 'auto-draft', 'open', 'open', '', '', '', '', '2020-06-10 06:59:37', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress-Ecomerce/?p=13', 0, 'post', '', 0),
(14, 1, '2020-06-10 06:59:38', '0000-00-00 00:00:00', 'The new common language will be more simple and regular than the existing European languages. It will be as simple as Occidental; in fact, it will be Occidental. To an English person, it will seem like simplified English, as a skeptical Cambridge friend of mine told me what Occidental is. The European languages are members of the same family.', 'Serious Problems with Cables in CIty', '', 'auto-draft', 'open', 'open', '', '', '', '', '2020-06-10 06:59:37', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress-Ecomerce/?p=14', 0, 'post', '', 0),
