(116, 1, '2019-09-29 06:48:10', '2019-09-29 04:48:10', 'More elegant, more compact and with a power dedicated to players, the PlayStation 4 Slim is a console of choice to enjoy dynamic, connected, fast video games with incredible graphics. Discover intelligent personalization possibilities, rich and integrated social applications, and innovative second screen features.\r\n\r\nIts content is incredibly rich, its gaming experiences more engaging than ever, and everyone can enjoy PlayStation exclusives and all of their favorite digital entertainment applications. The Sony PS4 console is designed to do it all. This new version of the PlayStation 4 sees its volume reduced by 30%, its reduced weight by 25% and an ever lower energy consumption. It also offers vivid and brilliant colors with breathtaking HDR graphics.', 'Sony PlayStation 4 500GB', 'There are many variations passages of Lorem Ipsum available, but the majority have suffered alteration words some form by injected or randomized which don\'t even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', 'publish', 'open', 'closed', '', 'rocky-mountain-2', '', '', '2020-06-10 19:23:07', '2020-06-10 17:23:07', '', 0, 'http://localhost/wordpress-Ecomerce/product/rocky-mountain-2/', 0, 'product', '', 1),
