(175, 1, '2020-06-10 19:18:06', '2020-06-10 17:18:06', '<span>The Limited Edition PS4 Pro Death Stranding Pack includes a custom 1 TB PS4 Pro system, as well as a custom DUALSHOCK 4 wireless controller, and the Death Stranding game on Blu-ray Disc.</span>\n\n<span>Inspired by the style of the game, this limited edition PS4 Pro system has a matt white coating, with two fingerprints of Stranded forming a world map, as well as a translucent orange DUALSHOCK 4 wireless controller reproducing the appearance of the game\'s BB capsule. </span>', 'Playstation4 Pro 1 To', 'There are many variations passages of Lorem Ipsum available, but the majority have suffered alteration words some form by injected or randomized which don\'t even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', 'inherit', 'closed', 'closed', '', '117-autosave-v1', '', '', '2020-06-10 19:18:06', '2020-06-10 17:18:06', '', 117, 'http://localhost/wordpress-Ecomerce/2020/06/10/117-autosave-v1/', 0, 'revision', '', 0),
