(178, 1, '2020-06-10 19:44:46', '0000-00-00 00:00:00', 'The Beats Pill<sup>+</sup> speaker has up to 12 hours of battery life to stay charged on the go. Get a quick charge in 3 hours with the Lightning cable and even charge your phone or external music device with extra power from your Beats Pill<sup>+</sup>. The LED fuel gauge lets you know how much battery is left.\n<div id=\"gtx-trans\" style=\"position: absolute; left: 102px; top: -0.4px;\">\n<div class=\"gtx-trans-icon\"></div>\n</div>', 'Beats Pill+', '', 'draft', 'open', 'closed', '', '', '', '', '2020-06-10 19:44:46', '2020-06-10 17:44:46', '', 0, 'http://localhost/wordpress-Ecomerce/?post_type=product&#038;p=178', 0, 'product', '', 0),
